import React, { Component } from 'react';
import ListCoursesComponent from './ListCoursesComponent';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import CourseComponent from './CourseComponent';
import AddMaterialForm from "./forms/AddMaterialForm";
import EditMaterialForm from "./forms/EditMaterialForm";

class MaterialApp extends Component {
    render() {
        return (
            <Router>
                <>
                    <h1>Materials Application</h1>
                    <Switch>
                        <Route path="/" exact component={ListCoursesComponent} />
                        <Route path="/material" exact component={AddMaterialForm} />
                        <Route path="/material/:id" component={EditMaterialForm} />
                    </Switch>
                </>
            </Router>
        )
    }
}

export default MaterialApp
